import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div id="wholeContainer">
      <h1 className="header">Bazinga Games</h1>
      <h2 className="subheader">
        Game buying, <u>made easy!</u>
      </h2>
    </div>
  );
};

export default Home;
